local function rawload(x, y, z)
	local p = 0x01000193
	local h = 0x811C9DC5
	for i = 1, #y do
		h = ((y:byte(i) ~ h) * p) & 0xFFFFFFFF
	end
	if h ~= z then
		error("checksum error on " .. x)
	end
	return assert(load(y, "=" .. x, "t", _ENV))
end
