local function lz4load(x, y, z)
	local a,b,c,d
	a = require("libpack.z85.decode")
	b = require("libpack.lz4.decode")
	c = a(y)
	d = b(c, z)
	if not d then error("checksum error on " .. x) end
	return assert(load(d, "=" .. x, "t", _ENV))
end
