local R = require
require = function(m, ...)
	if P[m] then
		if not P[m].l then
			local r = P[m].f(m, P[m].m, P[m].c)(...)
			if not P[m].s then return r end
			P[m].l = r
		end
		return P[m].l
	end
	return R(m, ...)
end
local o, r = pcall(require, "=main", ...)
require = R
if not o then
	print(r)
else
	return r
end
